import AppLayout from "../components/AppLayout";
import { useSelector } from "react-redux";
const Home = () => {
    const { isLoggedIn } = useSelector((state) => state.user);
    return (
        <AppLayout>
            <PostForm />
            <PostCard />
        </AppLayout>
    );
};

export default Home;
